import React, { useContext } from 'react';
import { TaskListContext } from '../context/TaskListContext';
import Task from './Task';
import './fontawesome';

const TaskList = () => {
    const { tasks } = useContext(TaskListContext)
    return (
        <div>
            Task List!
            <ul className='list'>
                {tasks.map((task) => <Task />)}
            </ul>
        </div>
    );
}

export default TaskList;
